import React, { useState } from "react";
const App=()=>{
    const [fullName,setFullName]=useState({
        fname:"",
        lname:"",
        email:"",
        phone:""
    })
    const fun1=(e)=>{
        const name=e.target.name;
        const val=e.target.value;
        console.log(name);
        console.log(val);
        setFullName((prevVal)=>{
             if(name==='fName'){
                return{
                fname:val,
                lname:prevVal.lname,
                email:prevVal.email,
                phone:prevVal.phone
                }
             }else if(name==="lName"){
                return{
                fname:prevVal.fname,
                lname:val,
                email:prevVal.email,
                phone:prevVal.phone
                }
             }
             else if(name==="Email"){
                return{
                fname:prevVal.fname,
                lname:prevVal.lname,
                email:val,
                phone:prevVal.phone
                }
             }
             else{
                return{
                fname:prevVal.fname,
                lname:prevVal.lname,
                email:prevVal.email,
                phone:val
                }
             }
        })
    }
    return (
        <>
            <div className="CLICK">
            <h1>Hello {fullName.fname} {fullName.lname}</h1>
            <p>{fullName.email}</p>
            <p>{fullName.phone}</p>
                <input type="text" placeholder={"Enter Your Name"} 
                 name='fName'
                 value={fullName.fname}
                 onChange={fun1}
                 />
                <input type="text" 
                placeholder={"Enter Your Last Name"} 
                name='lName'
                value={fullName.lname}
                onChange={fun1}
                />
                <input type={"email"}
                 name="Email"
                 value={fullName.email}
                 onChange={fun1}
                 placeholder="Enter Your Email"
                />
                <input type={"text"}
                 name="Phone"
                 value={fullName.phone}
                 onChange={fun1}
                 placeholder="Enter Your Phone Number"
                />
                <input type={"hidden"}
    
                 value={fullName.phone}
                 onChange={fun1}
                 placeholder="Enter Your Phone Number"
                />
                <button type="submit" 
                // onClick={fun}
                 >Submit</button>
            </div>
        </>
    )
}
export default App;
